import React from 'react';

function Contact() {
  return (
    <div style={{ display: 'flex', justifyContent: 'space-around' }}>
      <div style={{ flex: '1' }}>
        <img src="../../../han.jpeg" alt="Your Name" style={{ maxWidth: '100px' }} />
        <p>Your Address</p>
      </div>
      <div style={{ flex: '2' }}>
        <h1>Contact Information</h1>
        <h2>Email</h2>
        <p>janghan001112@gmail.com</p>
      </div>
    </div>
  );
}

export default Contact;
